  \ \"STEmpEmp_ID\",\n       \"NAME\" as \"STEmpName\",\n       \"PLANTYPE\" as \"\
  STEmpPlanType\",\n       \"PLANSTARTDATE\" as \"STEmpPlanStartDate\",\n       \"\
  PLANENDDATE\" as \"STEmpPlanEndDate\",\n       \"QUOTAEFFECTIVEDATEICMDEFAULT\"\
  \ as \"STEmpQuotaEffectiveDateICMdefault\",\n       \"QUOTACOMPONENT\" as \"STEmpQuotaComponent\"\
