  \ as \"STEmpProductGroup\",\n       \"ANNUALQUOTA_QC\" as \"STEmpAnnualQuota_QC\"\
  ,\n       \"Q1_QUOTA_QC\" as \"STEmpQ1QuotaQC\",\n       \"Q2_QUOTA_QC\" as \"STEmpQ2QuotaQC\"\
  ,\n       \"Q3_QUOTA_QC\" as \"STEmpQ3QuotaQC\",\n       \"Q4_QUOTA_QC\" as \"STEmpQ4QuotaQC\"\
  ,\n       \"ANNUAL_QUOTA_USD\" as \"STEmpAnnualQuota_USD\",\n       \"Q1_QUOTA_USD\"\
  \ as \"STEmpQ1QuotaUSD\",\n       \"Q2_QUOTA_USD\" as \"STEmpQ2QuotaUSD\",\n   \
  \    \"Q3_QUOTA_USD\" as \"STEmpQ3QuotaUSD\",\n       \"Q4_QUOTA_USD\" as \"STEmpQ4QuotaUSD\"\
  ,\n       \"CHANGEAPPROVALFLAG\" as \"STEmpChangeApprovalFlag\"\nFROM RDS.\"ANAPLAN\"\
  .\"TBL_CO_EMP_TERR_ASSIGNMENT\"\n--where \"NAME\" not in ('Nadir Ait Saadi');\n;"
